import PageMessage from "./container/pageMessages.js";
import {BrowserRouter as Router, Route} from 'react-router-dom'
import ModifyMessage from "./container/modifyMessage/modifyMessage.js";

function App() {
  return (
      <div className='App'>

        <Router>
        <PageMessage />

          <Route path="/profil/" exact component={profil}/>
          <Route path="/deconnexion/" exact component={deconnexion}/>
        </Router>

        <Router>
        <PageMessage />

          <Route path="/modifyMessage/" exact component={modifyMessage}/>
          <Route path="/SupprimerMessage/" exact component={supprimerMessage}/>
        </Router>

      </div> 

);

}

export default App
